    [],nt"num_tags": 5,nt"name": "narrative-reports-lacreek-national-waterfowl-refuge-august-september-october-1941",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lacreek Migratory
    Waterfowl Refuge outlines Refuge accomplishments from August through October of
    1941. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, predators,
    rodents, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and collections and receipts. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge uses and Refuge visitors. Photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
